children.value:
{
	$focus: { filter: 'invert(0.2) saturate(2) brightness(1.1)' },
	$hover: { filter: 'invert(0.15) saturate(1.5) brightness(1.1)' },
}

[
	css({
		$: {
			color: 'onSurface',
			position: 'relative',
			display: 'block',
			gridColumnEnd: 'span 12',
		},
		container: {
			position: 'relative',
			...padding(0, 12, 4, 12),
		},
		$invalid: { color: 'error' },
		$outline: { marginTop: -2 },
		container$outline: {
			borderColor: 'onSurface',
			borderWidth: 1,
			borderStyle: 'solid',
			borderRadius: 4,
			marginTop: 2,
			paddingTop: 12,
			paddingBottom: 12,
		},
		container$outline$focusWithin: {
			boxShadow: boxShadow(0, 0, 0, 1, 'primary'),
		},
		container$focusWithin$outline: {
			borderColor: 'primary',
		},
		container$invalid$outline: { borderColor: 'error' },
		container$invalid$outline$focusWithin: {
			boxShadow: boxShadow(0, 0, 0, 1, 'error'),
		},
		content: {
			display: 'flex',
			position: 'relative',
			font: 'default',
			marginTop: 4,
			lineHeight: 20,
		},
		content$focusWithin: {
			color: 'primary',
		},
		mask: {
			position: 'absolute',
			top: 0,
			right: 0,
			left: 0,
			bottom: 0,
			backgroundColor: 'onSurface8',
		},
		mask$outline: {
			borderRadius: 4,
			backgroundColor: 'surface',
		},
		mask$hover: {
			filter: 'invert(0.15) saturate(1.5) brightness(1.1)',
		},
		mask$hover$disabled: { filter: 'none' },
		label: {
			position: 'relative',
			font: 'caption',
			marginLeft: -4,
			paddingTop: 8,
			paddingBottom: 2,
			lineHeight: 10,
			verticalAlign: 'bottom',
		},
		label$focusWithin: { color: 'primary' },
		label$invalid: { color: 'error' },
		label$outline: {
			position: 'absolute',
			translateY: -17,
			paddingTop: 0,
			height: 5,
			backgroundColor: 'surface',
			display: 'inline-block',
		},
		label$floating$novalue: {
			font: 'default',
			translateY: 21,
			opacity: 0.75,
		},
		label$leading: { paddingLeft: 24 },
		label$floating$novalue$outline: {
			translateY: 9,
		},
	}),
	($: any) => (
		<div className="container">
			<div className="mask"></div>
			<div className="label">
				<$.Slot selector="cxl-label" />
			</div>
			<div className="content">
				<slot />
			</div>
		</div>
	),
]

((r: any) => {
	for (let i = 12; i > 0; i--)
		r.xl['$xl' + i] = r.lg['$lg' + i] = r.md['$md' + i] = r.sm[
			'$sm' + i
		] = r.xs['$xs' + i] = {
			display: 'block',
			gridColumnEnd: 'span ' + i,
			flexBasis: pct((100 / 12) * i),
		};
	return r;
})({
	xl: {},
	lg: {},
	md: {},
	sm: {},
	xs: {},
})

